import { HttpErrorResponse } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { IPrelogin } from 'src/app/model/model.interfaces';
import { CryptoService } from 'src/app/service/crypto.service';
import { SessionAjaxService } from 'src/app/service/session.ajax.service';

@Component({
  selector: 'app-login-routed',
  templateUrl: './login-routed.component.html',
  styleUrls: ['./login-routed.component.css']
})
export class LoginRoutedComponent implements OnInit {

  loginForm: FormGroup;
  status: HttpErrorResponse | null = null;
  prelogin: IPrelogin | null = null;
  notificationMessage: string | null = null;
  showNotification = false;

  constructor(
    private fb: FormBuilder,
    private sessionService: SessionAjaxService,
    private router: Router,
    private cryptoService: CryptoService
  ) {
    this.loginForm = this.fb.group({
      username: ['', [Validators.required]],
      contrasenya: ['', [Validators.required]],
      captcha: ['', [Validators.required]]
    });
  }

  getPreloginData() {
    this.sessionService.prelogin().subscribe({
      next: (data: IPrelogin) => {
        this.prelogin = data;
      },
      error: (error) => {
        this.status = error;
        this.showNotificationWithMessage('Error al obtener los datos de prelogin');
      }
    });
  }

  ngOnInit() {
    this.getPreloginData();
  }

  onSubmit() {
    if (this.loginForm.valid && this.prelogin) {
      let username = this.loginForm.get('username')?.value;
      let contrasenya = this.loginForm.get('contrasenya')?.value;
      let contrasenyaSHA256 = this.cryptoService.getSHA256(contrasenya);
      let token = this.prelogin.token;
      let answer = this.loginForm.get('captcha')?.value;
      this.sessionService.loginCaptcha(username, contrasenyaSHA256, token, answer).subscribe({
        next: (data: string) => {
          this.sessionService.setToken(data);
          this.sessionService.emit({ type: 'login' });
          this.router.navigate(['/home']);
        }, error: (error: HttpErrorResponse) => {
          this.status = error;
          this.showNotificationWithMessage('Error al iniciar sesión');
          this.getPreloginData();
          this.loginForm.reset();
        }
      });
    }
  }

  onReset() {
    this.loginForm.reset();
    this.getPreloginData();
  }

  loginAdmin() {
    this.loginForm.setValue({ username: 'jaimeseki99', contrasenya: 'noventaveinticuatro9024', captcha: '' });
  }

  loginUser() {
    this.loginForm.setValue({ username: 'sekimmortenn', contrasenya: 'noventaveinticuatro9024', captcha: '' });
  }

  showNotificationWithMessage(message: string) {
    this.notificationMessage = message;
    this.showNotification = true;
    setTimeout(() => {
      this.notificationMessage = null;
      this.showNotification = false;
    }, 2000); // Oculta la notificación después de 2 segundos
  }
}
<div class="flex items-center justify-center min-h-screen bg-gray-100">
  <div class="relative flex flex-col m-6 space-y-8 bg-white shadow-2xl rounded-2xl md:flex-row md:space-y-0">
    <div class="flex flex-col justify-center p-8 md:p-14">
      <span class="mb-3 text-4xl font-bold">Login</span>
      <span class="font-light text-gray-400 mb-8">
        ¡Bienvenid@! Introduce tus datos
      </span>
      <form [formGroup]="loginForm" (ngSubmit)="onSubmit()" class="py-4">
        <div class="py-4">
          <span class="mb-2 text-md">Username</span>
          <input type="text" class="w-full p-2 border border-gray-300 rounded-md placeholder-light placeholder-opacity-0" 
            name="username" id="username" formControlName="username" placeholder="Introduce tu nombre de usuario">
        </div>
        <div class="py-4">
          <span class="mb-2 text-md">Contraseña</span>
          <input type="password" class="w-full p-2 border border-gray-300 rounded-md placeholder-light placeholder-opacity-0" 
            name="contrasenya" id="contrasenya" formControlName="contrasenya" placeholder="Introduce tu contraseña">
        </div>
        <div class="py-4">
          <span class="mb-2 text-md">Captcha</span>
          <div class="flex items-center justify-center mb-2">
            <img [src]="'data:image/png;base64,' + prelogin?.captchaImage" alt="captcha" class="mr-2">
            <input type="text" id="captcha" name="captcha" formControlName="captcha" placeholder="Introduce el Captcha"
              class="w-1/2 p-2 border border-gray-300 rounded-md">
          </div>
        </div>
        <div class="flex justify-between w-full py-4">
          <div class="mr-24">
            <input type="checkbox" name="checkbox" id="checkbox" class="mr-2">
            <span class="text-md">Recuérdame</span>
          </div>
          <span class="font-bold text-md">¿Te has olvidado de la contraseña</span>
        </div>
        <button class="w-full bg-black text-white p-2 rounded-lg mb-6 hover:bg-white hover:text-black hover:border hover:border-gray-300">Login</button>
        <button type="button" class="w-full bg-black text-white p-2 rounded-lg mb-6 hover:bg-white hover:text-black hover:border hover:border-gray-300" (click)="loginAdmin()">Soy Admin</button>
        <button type="button" class="w-full bg-black text-white p-2 rounded-lg mb-6 hover:bg-white hover:text-black hover:border hover:border-gray-300" (click)="loginUser()">Soy Usuario</button>
      </form>
      <div class="text-center text-gray-400">
        ¿No tienes cuenta?
        <span class="font-bold text-black">Regístrate</span>
      </div>
    </div>
    <div class="relative">
      <img src="http://localhost:8085/media/neymar-236616.jpeg" alt="imagen de login" class="w-[400px] h-full hidden rounded-r-2xl md:block object-cover">
      <div class="absolute hidden bottom-10 right-6 p-6 bg-white bg-opacity-30 backdrop-blur-sm rounded drop-shadow-lg md:block">
      </div>
    </div>
  </div>
</div>
